import React from 'react';

const Widget = ({ title, temperature, windData }) => {


    return (

        <table className="ui two very basic column table">
            <tbody>
                <tr>
                    <td>
                        <h5>{title}</h5>
                    </td>
                </tr>
                <tr>
                    <td>
                        temp:{temperature}
                    </td>
                    <td>
                        wind:{windData ? windData.speed : 'none'}
                    </td>
                </tr>
            </tbody>
        </table>

    );
};

export default Widget;
